import java.util.*;

/**
 * <p>Given a string, find the length of the longest substring without repeating characters. For example, the longest substring without repeating letters for "abcabcbb" is "abc", which the length is 3. For "bbbbb" the longest substring is "b", with the length of 1..</p>
 *
 * @author Magic Joey
 * @version Solution.java 1.0 @2015/6/24 16:15 $
 */
public class Solution {

    public int lengthOfLongestSubstring(String s) {
        if(s.length()<2){
            return s.length();
        }
        int max = 0, current = 0, lastRepeat = 0;
        Map<Character, Integer> charPosMap = new HashMap<Character, Integer>(30);
        for (int pos = 0; pos < s.length(); pos++) {
            char curChar = s.charAt(pos);
            if(charPosMap.get(curChar)!=null ){
               int pre = charPosMap.get(curChar);

               current = lastRepeat>pre ? pos-lastRepeat:pos - pre;
               lastRepeat = pre;
            }else{
               current++;
            }
            System.out.println(current);
            charPosMap.put(curChar,pos);
            max = Math.max(max,current);
        }
        return max;
    }

    public int overTime(String s) {
        int maxLength = 0;

        char[] charArr = s.toCharArray();
        for (int off = 0; off < charArr.length; off++) {
            int temp = 0;
            List<Character> hashSet = new ArrayList<Character>(26);
            for (int inner = off; inner < charArr.length; inner++) {
                if (hashSet.contains(charArr[inner])) {
                    break;
                }
                hashSet.add(charArr[inner]);
                temp++;
            }
            maxLength = temp > maxLength ? temp : maxLength;
        }
        return maxLength;
    }



}

